import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Register.css';
import axios from 'axios';

class Register extends Component {
    state = {
        firstname: '',
        lastname: '',
        username: '',
        email: '',
        password: '',
        errorMessage: ''
    };

    handleSubmit = async (e) => {
        e.preventDefault();

        const { firstname, lastname, username, email, password } = this.state;

        try {
            const response = await axios.post('http://localhost:3001/register', {
                firstname,
                lastname,
                username,
                email,
                password,
            });

            if (response.data.success) {
                this.props.history.push('/login'); // Redirecionamento para a tela de login
            } else {
                this.setState({ errorMessage: response.data.message || 'Cadastro falhou' });
            }
        } catch (error) {
            console.error('Erro durante o registro:', error);
            this.setState({ errorMessage: 'Ocorreu um erro inesperado. Por favor, tente novamente mais tarde.' });
        }
    };

    handleChange = (e) => {
        this.setState({ [e.target.name]: e.target.value });
    };

    render() {
        const { firstname, lastname, username, email, password, errorMessage } = this.state;

        return (
            <div className="register-container">
                <h1>Registro</h1>
                <form onSubmit={this.handleSubmit}>
                    <input
                        type="text"
                        name="firstname"
                        placeholder="Primeiro nome"
                        value={firstname}
                        onChange={this.handleChange}
                    />
                    <input
                        type="text"
                        name="lastname"
                        placeholder="Sobrenome"
                        value={lastname}
                        onChange={this.handleChange}
                    />
                    <input
                        type="text"
                        name="username"
                        placeholder="Nome de usuário"
                        value={username}
                        onChange={this.handleChange}
                    />
                    <input
                        type="email"
                        name="email"
                        placeholder="E-mail"
                        value={email}
                        onChange={this.handleChange}
                    />
                    <input
                        type="password"
                        name="password"
                        placeholder="Senha"
                        value={password}
                        onChange={this.handleChange}
                    />
                    <input type="submit" value="Registrar" />
                </form>
                {errorMessage && <p>{errorMessage}</p>}
                <p>
                    Já possui uma conta? <Link to="/login">Faça login aqui</Link>
                </p>
            </div>
        );
    }
}

export default Register;
